// 비용과 날짜를 화면에 렌더링하는 컴포넌트

function ExpenseDate(props){
    const month = props.hello.toLocaleString('en-US',{month:'long'});
    const day = props.hello.toLocaleString('en-US',{day:'2-digit'});
    const year = props.hello.getFullYear();
    return (
        <div>
            <div>{month}</div>
            <div>{year}</div>
            <div>{day}</div>
        </div>
    )
}

export default ExpenseDate;
